            amount= {props.expenses[0].items} />
             <ExpenseItem title={props.expenses[1].items} date={props.expenses[1].items} 
            amount= {props.expenses[1].items} />
             <ExpenseItem title={props.expenses[2].items} date={props.expenses[2].items} 
            amount= {props.expenses[2].item} />
             <ExpenseItem title={props.expenses[3].items} date={props.expenses[3].items} 
            amount= {props.expenses[3].items} />


        </div>
    
  ) }


export default NewExpenses
